import './App.css';

function MyComponent() {
  return (
    <div>
      <h1>Hello from the reusable component</h1>
      <button>Like!</button>
    </div>
  );
}

function App() {
  return (
    <div className="App">
      <MyComponent />
      <MyComponent />
    </div>
  );
}

export default App;
